import React from 'react';
import Cards from '../../generic/cards/Cards';

const Home = () => {
  const p1 = 'What data do online services like DoorDash, Netflix, Tik Tok, YouTube, or Amazon collect from their consumers? Thanks to the [ACT] we all have rights to access the data that these online services collect from us. Explore posts where I explore the data that these online services collected from me. I hope this project can inspire others to think more about their most valuable asset: their data. '
  return (
  <div>
    <Cards />
  </div>
)};

export default Home;
